import React from 'react';
import styled from 'styled-components';
import wrapperBackground from '../../assets/container.png';

const Home = () => {

    const Wrapper = styled.div`
        background-image: url(${wrapperBackground});
        background-size: cover;
        background-repeat: no-repeat;
        position: relative;
        height: 100vh;
        width: 100vw;
        display: flex;
        align-items: center;
        flex-direction: column;
    `;

    const Title = styled.h1`
        position: relative;
        font-size: 50px;
        color: #ffffff;
        text-transform: uppercase;
        text-align: center;
        margin: auto;
        margin-top: 40vh;
        border-top: 1px solid #ffffff;
        border-left: 1px solid #ffffff;
        border-right: 1px solid #ffffff;
        :first{
            content: '';
            background-color: #ffffff;
            position: absolute;
            height: 1px;
            width: 40px;
            bottom: 0px;
            left: 10px;
        }
    `;

    const SubTitle = styled(Title)`
        font-size: 20px;
        margin-top: 30px;
        border-top: none;
    `;

    return(
        <Wrapper>
            <div>
                <Title>Mateusz Bacherycz</Title>
                <SubTitle>Web Developer</SubTitle>
            </div>
        </Wrapper>
    );

};

export default Home;
